(function(){var n=new Vue({created:function(){const n=this;n.getAllCategories()},data:function(){return{savedCategories:[],categories:[],categoryName:""}},methods:{addCategory:function(){const n=this;n.categories.push(n.categoryName);n.categoryName=""},removeCategory:function(n){const t=this;t.categories.splice(n,1)},deleteCategory:function(n,t){const i=this;bootbox.confirm({title:'<div class="row text-center">Varning<\/div>',message:'<div class="row text-center"><i class="fa fa-exclamation-triangle fa-5x text-danger"><\/i><\/div><div class="row text-center">Vil du ta bort denna kategori?<\/div>',buttons:{cancel:{label:'<i class="fa fa-times"><\/i> Avbryt',className:"btn-danger"},confirm:{label:'<i class="fa fa-check"><\/i> Ta bort',className:"btn-success"}},callback:function(r){r&&$.ajax({url:apiUrl+"Budget/Category/"+n,type:"DELETE",success:function(){i.savedCategories.splice(t,1);CreateConfirmModal("Kategorin togs bort")},error:function(n){CreateErrorModal(n.responseText)}})}})},saveCategories:function(){const n=this;$.ajax({url:apiUrl+"Budget/Categories",type:"POST",contentType:"application/json",data:JSON.stringify({Categories:n.categories}),success:function(){CreateConfirmModal("Kategorier sparades");n.categories=[];n.getAllCategories()},error:function(n){CreateErrorModal(n.responseText)}})},getAllCategories:function(){const n=this;$.ajax({url:apiUrl+"Budget/Categories",type:"GET",success:function(t){t&&(n.savedCategories=t)},error:function(n){CreateErrorModal(n.responseText)}})}}}).$mount("#createBudgetApp")})();